// SPDX-License-Identifier: MIT

pragma solidity >= 0.7.0 < 0.9.0;

interface UniswapV2Factory {
    function getPair(address tokenA, address tokenB) external view returns (address pair);
}

interface UniswapV2Pair {
    function getReserves(address factory, address tokenA, address tokenB) external view returns (uint reserveA, uint reserveB);
}

contract UniswapConnect {
    address private factory = 0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f;
    address private dai = 0x6B175474E89094C44Da98b954EedeAC495271d0F;
    address private weth = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;

    function getReserveTokens() external view returns (uint, uint){
        address pair = UniswapV2Factory(factory).getPair(dai, weth);
        (uint a, uint b) = UniswapV2Pair(pair).getReserves(factory, dai, weth);
        return (a,b);
    }
}

